import React, {Component} from 'react';
import { Container, Row, Col } from 'reactstrap';
import Profile from '../assets/photo1.png'


class Resume extends Component {
  render(){
    return (
      <Container className="about-body">
        <Row>
            <Col align='center'>
              <h1>Resume</h1>
            </Col>
          </Row>
          <Row>
            <Col xs="6">
              <div style={{textAlign:'center'}}>
                <img 
                  src={Profile} 
                  alt='profile'
                  style={{height: '200px'}}
                />   
              </div>  
              <h2 style={{paddingTop:'10px'}}>Santiago Guerra</h2>
              <h4 style={{color:'grey'}}>Programmer</h4>
            </Col>
            <Col xs="6" className="resume-right-col">
              <p>Right Side</p>    
            </Col>
          </Row>

      </Container>
    );
  }
}

export default Resume;
